import "./App.css";
import Nav from "./Nav";
import { Switch, Route, Redirect } from "react-router-dom";

function App({ colors }) {
  return (
    <div className="App">
      <Switch>
        <Route exact path="/colors">
          <ColorList />
        </Route>
        {/* <Route path="/dogs/:name">
          <DogDetails dogs={dogs} />
        </Route> */}
        <Redirect to="/" />
      </Switch>
    </div>
  );
}

App.defaultProps = { colors: ["red", "green", "blue"] };

export default App;
